Date.prototype.Format = function (fmt) {
    var o = {
        "M+": this.getMonth() + 1, 
        "d+": this.getDate(), 
        "h+": this.getHours(), 
        "m+": this.getMinutes(),
        "s+": this.getSeconds(), 
        "q+": Math.floor((this.getMonth() + 3) / 3),
        "S": this.getMilliseconds() 
    };
    if (/(y+)/.test(fmt))
        fmt = fmt.replace(RegExp.$1, (this.getFullYear() + "").substr(4 - RegExp.$1.length));
    for (var k in o){
        if (new RegExp("(" + k + ")").test(fmt)) {
            fmt = fmt.replace(RegExp.$1, (RegExp.$1.length == 1) ? (o[k]) : (("00" + o[k]).substr(("" + o[k]).length)));
        }
    }
    return fmt;
}

function getRequestParam() {
    var url = location.search;
    var theRequest = new Object();
    if (url.indexOf("?") != -1) {
        var str = url.substr(1);
        strs = str.split("&");
        for (var i = 0; i < strs.length; i++) {
            theRequest[strs[i].split("=")[0]] = unescape(strs[i].split("=")[1]);
        }
    }
    return theRequest;
}

function getAesKey(sBase64ed) {
    var sToday = new Date().Format("yyyyMMdd");
    var sBase64Parsed = CryptoJS.enc.Base64.parse(sBase64ed);
    const sBase64Plain = CryptoJS.enc.Utf8.stringify(sBase64Parsed);
    if (sBase64Plain.endsWith(sToday)) {
        var sAesKey = sBase64Plain.substr(0, sBase64Plain.length - 8);
        return sAesKey;
    }
    return null;

}

function getDecryptedData(sAesKey) {
    var encryptedData = '';
    const bytes = CryptoJS.AES.decrypt(encryptedData, sAesKey);
    const plaintext = bytes.toString(CryptoJS.enc.Utf8);
    oMyResume = JSON.parse(plaintext);
    return oMyResume;
}